def Extended_Euclid(r1, r2):

    r=0
    q=0
    s=0
    s1=1
    s2=0
    t=0
    t1=0
    t2=1
    tmp = r1

    while(r2):
  
        q = int(r1/r2)
        r = r1%r2
        s = s1 - q*s2
        t = t1 - q*t2

        r1 = r2
        r2 = r
        s1 = s2
        s2 = s
        t1 = t2
        t2 = t



    if(r1 == 1):
        if(t1 < 0):
            t1 += tmp
        return t1
    

    return 0
 
def EEA(a,b):
    r1,r2 = a, b
    s1,s2 = 1, 0
    t1,t2 = 0, 1
    
    while(r2>0):
        q = r1 // r2
        r = r1 - q * r2
        r1,r2 = r2,r
 
        s = s1 - q * s2
        s1,s2 = s2,s
 
        t = t1 - q * t2
        t1,t2 = t2,t
 
    print("{} = {}*({}) + {}*({})".format(r1, a,s1,b,t1))
 
